import React, { useState } from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import ListStagiaire from './ListStagiaire';
import ModifierSt from './ModifierSt';
import SupprimerSt from './SupprimerSt';
import AjouterSt from './AjouterSt';

const CheminF = () => {
    const [listStg,SetlistStg]=useState([
        {
            id:1,
            nom:"chaimae",
            prenom:"chaire",
            email:"chaimae@gmail.com",
            image:"femme1.PNG"
        },
        {
            id:2,
            nom:"aya",
            prenom:"sendi",
            email:"aya@gmail.com",
            image:"femme2.PNG"
        }
    ])
    const [NouveauStg,SetNouveauStg]=useState({})
    const ajouterstg =(nouveaustg)=>{
        console.log(nouveaustg)
        const l=  listStg.length+1
        SetNouveauStg({...nouveaustg,id: l})
        SetlistStg([...listStg,nouveaustg])
    }
    return (
        <>
            <BrowserRouter>
                <Routes>
                    <Route path='/' element={<ListStagiaire ListStg={listStg}/>} />
                    <Route path='/StagiaireAjouter' element={<AjouterSt ajouter={ajouterstg} />} />
                    <Route path='/StagiaireModifier/:id' element={<ModifierSt />} />
                    <Route path='/StagiaireSupprimer/:id' element={<SupprimerSt />} />
                </Routes>
            </BrowserRouter>
        </>
    );
}

export default CheminF;
